import React from 'react';
import ReactDOM from 'react-dom';

function ProfileCard(name, age, favIceCreamFlavor) {
    return (
        <div className="prof-card">
            <h1>name</h1>
            <img src={require('../imgs/profile.jpg')} alt={'Image of Caleb Bertrand'} width={'35px'}/>
            <h3>Age: age</h3>
            <p>Favorite Ice Cream Flavor: favIceCreamFlavor</p>
        </div>
    )
}

ReactDOM.render(
    <ProfileCard name={'Caleb'} age={19} favIceCreamFlavor={'Green Tea'} />

    , document.getElementById("root"));
